Bristol, North Somerset, and South Gloucestershire (BNSSG) Clinical Commissioning Groups (CCGs) seek to commission an organisation to provide an external quality and economic evaluation of a new 12 month hub & spoke Core 24 (Out of Hours) Mental Health Psychiatric Liaison service model across BNSSG, sited in both Southmead and Bristol Royal Infirmary hospitals from 1st April 2018, with some work starting from 1st February 2018.

Aim of the Evaluation
The primary aims of the evaluation are to evidence the worth of the service in relation to:
	Improved patient experience of attendance in emergency departments with mental health presentation; 
	Improved colleague/staff experience of mental health presentations in emergency departments;
	Improved system flow of patients through emergency departments and wards of patients with mental health presentations through reduced breaches and reduced delays to treatment and discharge;
	Monetary benefits to system partners (Acute Hospital Trusts, Ambulance, Police, CCGs, Mental Health Trust, Local Authorities) of improved overnight service delivery;

This procurement is being carried out by NHS South, Central & West Commissioning Support Unit (SCW) on behalf of the Commissioners. This is a restricted process in that Expressions of interest are required by no later than midday on Monday 18th December.

Those organisations who have expressed an interest will receive a final version of the specification and ITT documents. These organisations will have until midday on Wednesday 10th January 2018 to bid.

Additional Information released on the 12th December: Commissioners are able to provide indicative details of procurement processes commencing on the 5th January 2018 with a response deadline of the 26th January. Following evaluation and decision process the mobilisation period is envisioned to be March to May 2018.

Additional information: Interested providers will be able to view the tender opportunity via the 'current tenders' list on the e-procurement system https://in-tendhost.co.uk/scwcsu/aspx/Home 

Interested bidders are also required to express their Expression of Interest by midday on Monday 18th December, at which point they will receive the final specification and then be required to respond to the ITT questions directly within the system and attach any requested documents separately to the placeholders provided by the closing date of 10th January 2018, 12.00pm (midday).
